(870, 'B2S_MULTI_WIDGET', 'a:2:{s:9:\"timestamp\";s:19:\"2020-04-26 23:42:12\";s:7:\"content\";s:12563:\"[{\"title\":\"#StaySocial: Covid-19 Crisis Communication Updates\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/04\\/widget-covid19-update-landingpage-blog2social-2020.png\' style=\'width: 200px;height: 200px;\' alt=\'Covid-19 Crisis Communication Updates\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 15px\\\">\\r\\nWe support your social media team to manage social media crisis communication - even when practising social distancing by working remotely.\\r\\n<\\/p>\\r\\n<a href=\'https:\\/\\/prg.li\\/crisis-communication-social-media \'target=\'_blank\' class=\'btn btn-primary\' title=\'Learn more\'>Learn more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"#StaySocial with Blog2Social\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/04\\/widget-code-staysocial.png\' style=\'width: 200px;height: 200px;\' alt=\'#StaySocial Blog2Social Promotion Code\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 15px\\\">\\r\\nIn the current crisis situation a transparent and consistent communication is the lifeline to your customers and community.  <br>\\r\\nWe want to help you in these difficult times by providing a special discount code to save 10 EUR for all Blog2Social Premium licenses.\\r\\nYou will get your 10 Euro discount with the code: <b>StaySocial <\\/b> <br>\\r\\nThis code can be used by new customers and for all upgrades.\\r\\n<\\/p>\\r\\n<a href=\'https:\\/\\/prg.li\\/staysocial-en \'target=\'_blank\' class=\'btn btn-primary\' title=\'Buy Blog2Social Premium\'>Buy Blog2Social Premium<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"How to Handle the Coronavirus Crisis: Communication Strategies for Your Business\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/03\\/widget-corona-blog-post.png\' style=\'width: 200px;height: 200px;\' alt=\'Crisis Communication Strategies\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 20px\\\">\\r\\nHowever you are affected by the coronavirus crisis, providing transparent and ongoing crisis communication is the hallmark of a professional response. Whether you have an emergency plan for crisis communication in place or not, it is never too late to start. Learn which essential steps you can take to respond to a crisis situation.\\r\\n<\\/p>\\r\\n<a href=https:\\/\\/www.blog2social.com\\/en\\/blog\\/how-to-handle-crisis-communication-strategies\\/?utm_source=plugin&utm_medium=widget&utm_campaign=corona0320 \'target=\'_blank\' class=\'btn btn-primary \'title=\'Crisis Communication Strategies\'>read the full blog post<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"Version 6.2 Re-share your posts automatically & use Sniply\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/03\\/release-6.2-widget.png\' style=\'width: 200px;height: 200px;\' alt=\'Release 6.2\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 20px\\\">\\r\\nUpdate Blog2Social to version 6.2 to re-schedule and re-share your blog content automatically. Use the Sniply URL shortener and benefit from more enhanced usability features.\\r\\n<\\/p>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/faq\\/index.php?action=news&newsid=71&newslang=en\' target=\'_blank\' class=\'btn btn-primary\' title=\'FAQ News Release 6.2\'>learn more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"Re-share your posts automatically\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/03\\/Re-share-widget.png\' style=\'width: 200px;height: 200px;\' alt=\'Re-Share\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 20px\\\">\\r\\nKeep your social media feed updated automatically with awesome content and save valuable time by reviving your evergreen content regularly. Automate your resharing process with Blog2Social, so you can use your time to create new content and interact with your community. \\r\\n<\\/p>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/faq\\/index.php?action=artikel&cat=3&id=165&artlang=en\' target=\'_blank\' class=\'btn btn-primary\' title=\'Re-share posts automatically\'>learn more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"Use Sniply and add CTA snips to your short links\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/03\\/sniply-widget.png\' style=\'width: 200px;height: 200px;\' alt=\'Sniply\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 20px\\\">\\r\\nUse Sniply to increase conversions from every piece of content you share. It\\u2019s easy: Connect your Sniply account to Blog2Social. Select your brand and your CTA snip and Blog2Social will automatically attach your Sniply short links to your social media posts.\\r\\n<\\/p>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/faq\\/index.php?action=artikel&cat=6&id=166&artlang=en\' target=\'_blank\' class=\'btn btn-primary\' title=\'How to use Sniply\'>learn more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"New: Use URL Parameters to Track Your Link Performance\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/01\\/widget-url-parameters.png\' style=\'width: 200px;height: 200px;\' alt=\'URL Parameter\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 20px\\\">\\r\\nUse UTM parameters to track your marketing success in Google Analytics or use other URL parameters.\\r\\n<\\/p>\\r\\n<a href=https:\\/\\/www.blog2social.com\\/en\\/faq\\/index.php?action=artikel&cat=6&id=164&artlang=en\' target=\'_blank\' class=\'btn btn-primary\' title=\'FAQ URL Parameters\'>learn more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"New: Revised Autoposter\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2020\\/01\\/widget-autoposter.png\' style=\'width: 200px;height: 200px;\' alt=\'Revised Autoposter\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 20px\\\">\\r\\nSetting up and working with the autoposter for your social media posts is easier and faster than ever with the new revised autoposter settings.\\r\\n<\\/p>\\r\\n<a href=https:\\/\\/www.blog2social.com\\/en\\/faq\\/index.php?action=artikel&cat=3&id=72&artlang=en\' target=\'_blank\' class=\'btn btn-primary\' title=\'FAQ Autoposter\'>learn more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"A look into the tool with Jerry Banfield on YouTube\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2019\\/07\\/jerry-banfield-widget.png\' style=\'width: 200px;height: 200px;\' alt=\'A look into the tool with Jerry Banfield on YouTube\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 10px; font-size: 16px\\\">Jerry Banfield uploaded a 24-minute video with a look into the tool and explanation of all features of Blog2Social on YouTube:<\\/p>\\r\\n<p style=\\\"padding-bottom: 10px; font-size: 16px; font-style: italic\\\">\\u201eThis is giving me thousands of extra impressions on my blog every day. This is why I\\u2019ve taken the time to show this to you. \\u2013 I just signed up for this. I found it really helpful. So I thought to make a tutorial.\\u201c<\\/p>\\r\\n<p style=\\\"padding-bottom: 10px; font-size: 16px\\\">Watch the video: <a href=\\\"https:\\/\\/youtu.be\\/TknuQYnmHEU\\\" target=\\\"_blank\\\" title=\\\"Watch the video\\\">\\u00bb https:\\/\\/youtu.be\\/TknuQYnmHEU<\\/a><\\/p>\\r\\n<p style=\\\"padding-bottom: 10px; font-size: 16px\\\">More of Jerry\\u2019s social media strategy: <a href=\\\"https:\\/\\/youtu.be\\/pJuGiJymBEY\\\" target=\\\"_blank\\\" title=\\\"Watch the video\\\">\\u00bb https:\\/\\/youtu.be\\/pJuGiJymBEY<\\/a><\\/p>\\r\\n<\\/div><\\/div>\"},{\"title\":\"Business Blogs: Why Blogs are Important for Your Business\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2019\\/04\\/business-blogs-why-blogs-are-important-for-your-business.png\' style=\'width: 200px;height: 200px;\' alt=\'Business Blogs: Why Blogs are Important for Your Business\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 16px\\\">Business blogs have become an integral part of corporate social media communication. A successful corporate blog can increase a company\\u2019s reach and visibility in search engines, strengthen its reputation, and serve as a content center for internal and external communication.<\\/p>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/business-blogs-important\\/\' target=\'_blank\' class=\'btn btn-primary\' title=\\\"\\\">read blogpost<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"Ultimate Guide: How to Write, Optimize and Promote Blog Posts\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2019\\/04\\/ultimate-guide-write-optimize-and-promote-blog-posts.png\' style=\'width: 200px;height: 200px;\' alt=\'Ultimate Guide: How to Write, Optimize and Promote Blog Posts + Checklist\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 16px\\\">Creating unique content that stands out from millions of other reading options has become more difficult than ever. Just take a look at the internet life stats on the millions of blog posts that are published per day. Every blogger has to work hard to get to the top of the ever-growing blogosphere.<\\/p>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/ultimate-guide-write-optimize-promote-blog-posts-checklist\\/\' target=\'_blank\' class=\'btn btn-primary\' title=\\\"\\\">read blogpost<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"How to Use the Power of Visuals to Drive More Traffic to Your Blog\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2019\\/04\\/how-to-use-the-power-of-visuals-to-drive-more-traffic-to-your-blog.png\' style=\'width: 200px;height: 200px;\' alt=\'How to Use the Power of Visuals to Drive More Traffic to Your Blog\'>\\r\\n<div style=\\\"margin: 0 0 5px 10px;\\\">\\r\\n<p style=\\\"padding-bottom: 5px; font-size: 22px;\\\">7 tips and tools for your blog marketing with visual content<\\/p>\\r\\n<p style=\\\"padding-bottom: 15px; font-size: 16px;\\\">Visuals can have an enormous impact on the success of your blog and your social media campaigns. Photos, videos or infographics grab user attention much faster and more effectively than text.<\\/p>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/visuals-more-traffic-on-your-blog\\/\' target=\'_blank\' class=\'btn btn-primary\' title=\\\"\\\">read blogpost<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"10 Tips & Tools to Promote your Blog\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/wp-content\\/uploads\\/2017\\/11\\/Preisanpassung-9.png\' style=\'width: 200px; height: 200px\'>\\r\\n<div>\\r\\n<span style=\'font-size: 12px\'>\\r\\n<div style=\\\";margin-left: 10px;\\\">\\r\\n<span class=\\\"glyphicon glyphicon-bookmark glyphicon-success\\\">\\r\\n<\\/span> Posts from Blog2Social<\\/span><\\/div>\\r\\n<br>\\r\\n<div style=\\\";margin-left: 10px;\\\">\\r\\n<span style=\'font-size:16px;margin-bottom: 5px; margin-top: 5px\'>\\r\\nLooking for tips and tools to promote your blog post? Here are 10 things you can do to <strong>promote your blog post<\\/strong>, after hitting the publish-button. Drive readers to your blog and increase the performance of your post!\\r\\n<br>\\r\\n<br>\\r\\n<a href=\'https:\\/\\/www.blog2social.com\\/en\\/blog\\/10-tips-tools-promote-blog-post-checklist\\/\' target=\'_blank\' class=\'btn btn-primary\'>read more<\\/a>\\r\\n<\\/div><\\/div>\"},{\"title\":\"Recommend Blog2Social and Earn Cash\",\"content\":\"<div class=\'b2s-widget-block-image-content\'><img src=\'https:\\/\\/files.blog2social.com\\/wp\\/images\\/en\\/affiliate.png\' style=\'width: 200px; height: 200px\'><div><span style=\'color:#79B232;display:inline-block;width:45px;text-align:right;\'>15%<\\/span> commission per sale<br><span style=\'color:#79B232;display:inline-block;width:45px;text-align:right;\'>5%<\\/span> lifetime comission<br><span style=\'font-size:16px;margin-bottom: 5px;\'>Sign up now in less than 5 minutes and get paid for each referral.<br><br><\\/span><a href=\'https:\\/\\/www.blog2social.com\\/en\\/affiliate\\/\' target=\'_blank\' class=\'btn btn-primary\'>learn more<\\/a><\\/div><\\/div>\"}]\";}', 'no'),
