	(31, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Fusce non nunc mi. Integer placerat nulla id quam varius dapibus. Nulla sit amet tellus et purus lobortis efficitur. Vivamus tempus posuere ipsum in suscipit. Quisque pulvinar fringilla cursus. Morbi malesuada laoreet dui, vitae consequat arcu vehicula vel. Fusce vel turpis non ante mollis bibendum a ac risus. Morbi ornare ipsum sit amet enim rhoncus, sed eleifend felis tristique. Mauris sed sollicitudin libero. In nec lacus quis erat rhoncus molestie.', 'Get more nutrition in every bite', '', 'inherit', 'closed', 'closed', '', '23-revision-v1', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 23, 'http://localhost/SalafiWebsite/2020/04/27/23-revision-v1/', 0, 'revision', '', 0),
	(32, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'The young team of Franziska Hildebrand, Franziska Preuss, Vanessa Hinz and Dahlmeier clocked 1 hour, 11 minutes, 54.6 seconds to beat France by just over 1 minute. Italy took bronze, 1:06.1 behind. Germany missed six targets overall, avoiding any laps around the penalty loop. Maria Dorin Habert of France, who has two individual gold medals at these worlds, passed Russia and France on the last leg and to take her team from fourth to second.', 'Women’s Relay Competition', '', 'inherit', 'closed', 'closed', '', '24-revision-v1', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 24, 'http://localhost/SalafiWebsite/2020/04/27/24-revision-v1/', 0, 'revision', '', 0),
	(33, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Chocolate bar marzipan sweet marzipan. Danish tart bear claw donut cake bonbon biscuit powder croissant. Liquorice cake cookie. Dessert cotton candy macaroon gummies sweet gingerbread sugar plum. Biscuit tart cake. Candy jelly ice cream halvah jelly-o jelly beans brownie pastry sweet. Candy sweet roll dessert. Lemon drops jelly-o fruitcake topping. Soufflé jelly beans bonbon.', 'A Paradise for Holiday', '', 'inherit', 'closed', 'closed', '', '25-revision-v1', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 25, 'http://localhost/SalafiWebsite/2020/04/27/25-revision-v1/', 0, 'revision', '', 0),
	(34, 1, '2020-04-27 14:32:31', '2020-04-27 12:32:31', 'Nunc consectetur ipsum nisi, ut pellentesque felis tempus vitae. Integer eget lacinia nunc. Vestibulum consectetur convallis augue id egestas. Nullam rhoncus, arcu in tincidunt ultricies, velit diam imperdiet lacus, sed faucibus mi massa vel nunc. In ac viverra augue, a luctus nisl. Donec interdum enim tempus, aliquet metus maximus, euismod quam. Sed pretium finibus rhoncus. Phasellus libero diam, rutrum non ipsum ut, ultricies sodales sapien. Duis viverra purus lorem.', 'Destruction in Montania', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2020-04-27 14:32:31', '2020-04-27 12:32:31', '', 26, 'http://localhost/SalafiWebsite/2020/04/27/26-revision-v1/', 0, 'revision', '', 0),
